package ra.dev.model.serviceImp;import org.springframework.beans.factory.annotation.Autowired;import org.springframework.stereotype.Service;import ra.dev.model.entity.Contact;import ra.dev.model.repository.ContacRepository;import ra.dev.model.service.ContactService;import javax.transaction.Transactional;import java.sql.SQLException;import java.util.List;@Service@Transactional(rollbackOn = SQLException.class)public class ContactServiceImp implements ContactService {    @Autowired    ContacRepository contacRepository;    @Override    public List<Contact> findAll() {        return contacRepository.findAll();    }    @Override    public Contact findByID(int contactID) {        return contacRepository.findById(contactID).get();    }    @Override    public Contact saveOrUpdate(Contact contact) {        return contacRepository.save(contact);    }    @Override    public void delete(int contactID) {        contacRepository.deleteById(contactID);    }    @Override    public List<Contact> searchByName(String fullName) {        return null;    }}